  \"amchitka-aquatic-ecology-studies-third-quarter-january-through-march-1968-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of the aquatic ecology study
  include an assessment of the fish and aquatic invertebrate populations in the streams
  and in the ponds throughout the entire year. Most of the work which was to be done
  on these populations was to be accomplished during the productive or summer months;
  however, it was necessary to establish observations on these populations during
  the winter periods. Accordingly, a trip was made in December, 1967, and one in March,
  1968, during which both the fish and invertebrate populations were sampled and examined
  for seasonal variation in terms of both species and numbers.\",\n\t\"license_title\":
